import React from "react";
import styles from './users.module.css?ver=123'


let Users = (props) => {
    let onFollowed = (id) =>{
        props.followAC(id);
    }
    let onUnFollowed = (id) =>{
        props.unfollow(id);
    }
    return (

        props.users.map(el =><div key={el.id}>
                <span>
                    <div>
                        <img src={el.photoUrl} alt="" className={styles.userPhoto}/>
                    </div>
                    <div>
                        {el.followed ? <button onClick={onFollowed(el.id)}>followed</button> : <button>unfollowed</button>}
                    </div>
                </span>
                <span>
                    <span>
                        <div>{el.fullName}</div>
                        <div>{el.status}</div>
                        </span><span>
                        <div>{el.location.city}</div>
                        <div>{el.location.country}</div>
                        </span>
                </span>
            </div>
        )
    )
}

export default Users;
